// HamburgerMenu.js

import React from 'react';
import { Navbar, Container, Collapse } from 'react-bootstrap';

const HamburgerMenu = () => {
  return (
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Toggle aria-controls="navbarToggleExternalContent" />
        <Navbar.Collapse>
          <Collapse id="navbarToggleExternalContent" className="bg-dark p-4">
            <h5 className="text-body-emphasis h4">Collapsed content</h5>
            <span className="text-body-secondary">Toggleable via the navbar brand.</span>
          </Collapse>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default HamburgerMenu;
